import React, { Component } from "react";
import CardContact from "./CardContact";


class ContactList extends Component {
    constructor( props ) {
        super( props );
        this.state = {};
        this.listContact = props.listContact;
    }
    render () {
        <>
            {this.props.listContact.map( ( contact ) => {
                return <CardContact prenom={contact.prenom} nom={contact.nom} group={contact.group} biographie={contact.biographie} />
            } )}
        </>
    }
}

export default ContactList;
